import { BehaviorSubject } from "rxjs";

export default class Env {
  private static _audioVolume: BehaviorSubject<number> = new BehaviorSubject(
    0.2
  );
  public static audioVolume$() {
    return this._audioVolume.asObservable();
  }
}
